import styled from 'styled-components'
import { Link as LinkR } from 'react-router-dom'

export const Logo = styled(LinkR)`
    font-size: 1rem;
    font-weight: 700;
    text-decoration: none;
    color: #fff;
`

export const NavbarLogo = styled.div`
    justify-self: start;
    margin-left: 20px;
    cursor: pointer;
`
